INSERT INTO tb_abilidade(Name,Effect) VALUES ('Synchronize','The attacker will receive the same status condition if it inflicts a burn, poison, or paralysis to the Pokémon.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Tangled Feet','Raises evasiveness if the Pokémon is confused.');
