INSERT INTO tb_abilidade(Name,Effect) VALUES ('Tinted Lens','The Pokémon can use "not very effective" moves to deal regular damage.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Torrent','Powers up Water-type moves when the Pokémon''s HP is low.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Tough Claws','Powers up moves that make direct contact.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Toxic Boost','Powers up physical attacks when the Pokémon is poisoned.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Trace','When it enters a battle, the Pokémon copies an opposing Pokémon''s Ability.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Transistor','Powers up Electric-type moves.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Triage','Gives priority to a healing move.');
