INSERT INTO tb_abilidade(Name,Effect) VALUES ('Turboblaze','Moves can be used on the target regardless of its Abilities.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Unaware','When attacking, the Pokémon ignores the target Pokémon''s stat changes.');
