INSERT INTO tb_abilidade(Name,Effect) VALUES ('Victory Star','Boosts the accuracy of its allies and itself.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Vital Spirit','The Pokémon is full of vitality, and that prevents it from falling asleep.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Volt Absorb','Restores HP if hit by an Electric-type move instead of taking damage.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Wandering Spirit','The Pokémon exchanges Abilities with a Pokémon that hits it with a move that makes direct contact.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Water Absorb','Restores HP if hit by a Water-type move instead of taking damage.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Water Bubble','Lowers the power of Fire-type moves done to the Pokémon and prevents the Pokémon from getting a burn.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Water Compaction','Boosts the Pokémon''s Defense stat sharply when hit by a Water-type move.');
