INSERT INTO tb_abilidade(Name,Effect) VALUES ('Weak Armor','Physical attacks to the Pokémon lower its Defense stat but sharply raise its Speed stat.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('White Smoke','The Pokémon is protected by its white smoke, which prevents other Pokémon from lowering its stats.');
