INSERT INTO tb_abilidade(Name,Effect) VALUES ('Wonder Guard','Its mysterious power only lets supereffective moves hit the Pokémon.');
INSERT INTO tb_abilidade(Name,Effect) VALUES ('Wonder Skin','Makes status moves more likely to miss.');
